import React from "react";
import axios from "axios";
import styled from "styled-components";
import { FaTrash, FaEdit } from "react-icons/fa";
import { toast } from "react-toastify";

const Table = styled.table`
  width: 100%;
  background-color: #fff;
  padding: 20px;
  box-shadow: 0px 0px 5px #ccc;
  border-radius: 5px;
  max-width: 1120px;
  margin: 20px auto;
  word-break: break-all;
`;

const Thead = styled.thead`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
`;

const Tr = styled.tr`
  width: 100%;
  display: flex;
  justify-content: flex-start;
  align-items: flex-start;
`;

const Th = styled.th`
  text-align: left;
  border-bottom: 1px solid #ddd;
  padding: 10px;
  width: 100%;
`;

const Td = styled.td`
  padding: 10px;
  text-align: left;
  border-bottom: 1px solid #ddd;
`;

const Grid = ({ users, setUsers, setOnEdit }) => {
  const handleEdit = (item) => {
    setOnEdit(item);
  };

  const handleDelete = async (id) => {
    await axios
      .delete("http://localhost:8800/" + id)
      .then(({ data }) => {
        const newArray = users.filter((user) => user.id !== id);
        setUsers(newArray);
        toast.success(data);
      })
      .catch(({ data }) => toast.error(data));
    setOnEdit(null);
  };

  return (
    <Table>
      <Thead>
        <Tr>
          <Th>Nome</Th>
        </Tr>
        <Tr>
          <Th>Sobrenome</Th>
        </Tr>
        <Tr>
          <Th>Cpf</Th>
        </Tr>
        <Tr>
          <Th>Telefone</Th>
        </Tr>
        <Tr onlyWeb>
          <Th>E-mail</Th>
        </Tr>
        <Tr onlyWeb>
          <Th>Senha</Th>
        </Tr>
        <Tr onlyWeb>
          <Th>Endere√ßo</Th>
        </Tr>
        <Tr>
          <Th></Th>
        </Tr>
        <Tr>
          <Th></Th>
        </Tr>
      </Thead>
      <tbody>
        {users.map((item, i) => (
          <Tr key={i}>
            <Td>{item.nome}</Td>
            <Td>{item.sobrenome}</Td>
            <Td>{item.cpf}</Td>
            <Td>{item.celular}</Td>
            <Td onlyWeb>{item.email}</Td>
            <Td onlyWeb>{item.senha}</Td>
            <Td onlyWeb>{item.endereco}</Td>
            <Td alignCenter>
              <FaEdit onClick={() => handleEdit(item)} style={{ cursor: "pointer" }} />
            </Td>
            <Td alignCenter>
              <FaTrash onClick={() => handleDelete(item.id)} style={{ cursor: "pointer" }} />
            </Td>
          </Tr>
        ))}
      </tbody>
    </Table>
  );
};

export default Grid;
